import React from 'react';
import './styles.css';

const Result = ({ resultImage }) => {
  return (
    <div className="column" id="result">
      <h2>Result</h2>
      {resultImage ? <img src={resultImage} alt="Document Preview" /> : <p>No image to display</p>}
    </div>
  );
};

export default Result;
